import{_ as t,o,c as a,z as e,a as n}from"./chunks/framework.9482e208.js";const y=JSON.parse('{"title":"§ 8.01-211 When venditioni exponas issued to sheriff of adjacent county; what to contain.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-211.md","filePath":"vacode/8.01-211.md"}'),s={name:"vacode/8.01-211.md"},i=e("h1",{id:"§-8-01-211-when-venditioni-exponas-issued-to-sheriff-of-adjacent-county-what-to-contain",tabindex:"-1"},[n("§ 8.01-211 When venditioni exponas issued to sheriff of adjacent county; what to contain. "),e("a",{class:"header-anchor",href:"#§-8-01-211-when-venditioni-exponas-issued-to-sheriff-of-adjacent-county-what-to-contain","aria-label":'Permalink to "§ 8.01-211 When venditioni exponas issued to sheriff of adjacent county; what to contain."'},"​")],-1),h=e("p",null,"When return is made on any execution on behalf of the Commonwealth that goods, chattels or real estate remain unsold for want of bidders, or to that effect, the clerk of the court from which such execution issued shall, when required by the Comptroller, issue a writ of venditioni exponas, directed to the sheriff of any county adjacent to that in which the levy was made that the Comptroller may designate. Such writ shall recite the execution under which the levy was made, the nature of such levy and return that the property remains unsold for the want of bidders and shall command the sheriff of such adjacent county, if the property remaining unsold be goods or chattels, to go into the county in which the levy was made and receive the same from the officer that made the levy and, whether the property be goods, chattels, or real estate, to sell the same.",-1),r=e("p",null,"Code 1950, § 8-774; 1977, c. 617.",-1),c=[i,h,r];function d(f,l,u,m,p,w){return o(),a("div",null,c)}const v=t(s,[["render",d]]);export{y as __pageData,v as default};
